import React, { useState } from 'react';

import ButtonBlock from './ButtonBlock';

function AutomationButtonsBlocks(props) {

    const namesLetters_A = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'A',
        'letter3': ''
    }
    const namesLetters_O = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'О',
        'letter3': ''
    }
    const namesLetters_U = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'У',
        'letter3': ''
    }
    const namesLetters_I = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'И',
        'letter3': ''
    }
    const namesLetters_II = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'Ы',
        'letter3': ''
    }
    const namesLetters_E = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'Е',
        'letter3': ''
    }
    const namesLetters_Ee = {
        'letter1': props.match.params.name.toUpperCase(),
        'letter2': 'Э',
        'letter3': ''
    }
    const classnameLetters = {
        'buttonLetter': 'buttonLetter',
        'letter1': 'letter1',
        'letter2': 'letter2',
        'letter3': 'letter3'
    }

    const [levelEnd, setLevelEnd] = useState({
        'block_1': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        },
        'block_2': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        },
        'block_3': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        },
        'block_4': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        },
        'block_5': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        },
        'block_6': {
            'button_1': false,
            'button_2': false,
            'button_3': false,
        }
    })

    const hendlerLevelEnd = () => {

    }


    return (
        <div className="automation-buttons-blocks">

            <div>Тип буквы {props.match.params.id} буква {props.match.params.name}</div>
            <div>
                <ButtonBlock
                    namesLettersButton_1={namesLetters_A}
                    namesLettersButton_2={namesLetters_A}
                    namesLettersButton_3={namesLetters_A}
                    classnameLetters={classnameLetters}
                />
                <ButtonBlock
                    namesLettersButton_1={namesLetters_O}
                    namesLettersButton_2={namesLetters_O}
                    namesLettersButton_3={namesLetters_O}
                    classnameLetters={classnameLetters}
                />
                <ButtonBlock
                    namesLettersButton_1={namesLetters_U}
                    namesLettersButton_2={namesLetters_U}
                    namesLettersButton_3={namesLetters_U}
                    classnameLetters={classnameLetters}
                />
                <ButtonBlock
                    namesLettersButton_1={namesLetters_I}
                    namesLettersButton_2={namesLetters_I}
                    namesLettersButton_3={namesLetters_I}
                    classnameLetters={classnameLetters}
                />
                <ButtonBlock
                    namesLettersButton_1={namesLetters_II}
                    namesLettersButton_2={namesLetters_II}
                    namesLettersButton_3={namesLetters_II}
                    classnameLetters={classnameLetters}
                />
                <ButtonBlock
                    namesLettersButton_1={namesLetters_E}
                    namesLettersButton_2={namesLetters_E}
                    namesLettersButton_3={namesLetters_E}
                    classnameLetters={classnameLetters}
                />

            </div>
        </div>
        
     )
}

export default AutomationButtonsBlocks
